import PropTypes from 'prop-types';


function Header({text}) {
  if(typeof text ==='string'){
  return (

  <header>
    <div className="container">
    <h2>{text}</h2>
    </div>
  </header>
  );
  }
  else alert('not string')
}

Header.defaultProps={
    text:'Feedback UI'
}

Header.propTypes={
    text:PropTypes.string
}
export default Header;
